class List extends React.Component {
	render() {
	  var countries = [
		{ name: "Abduraghmaan", capital: "Delhi" },
		{ name: "Belgium", capital: "Brussels" },
		{ name: "France", capital: "Paris" },
		{ name: "Greece", capital: "Athens" }
	  ];

	  return(
				countries.map( country => (
  			<div>{country.name}</div>
				))
		);
	}
  }

